    return (

            <div className="selector">
            <div className="selector-header">
                <p><TypewriterText speed={10}>Skynet is a community driven decentralized compute platform built on top of
the Antelope blockchain stack</TypewriterText></p>
            </div>
            <div className="selector-body">
                <div className="selector-options">
                    <button className="option" ><TypewriterText hover={true} ticking={true}>/Intro</TypewriterText></button>
                    <button className="option" ><TypewriterText hover={true} ticking={true}>/Alpha</TypewriterText></button>
                    <button className="option" ><TypewriterText hover={true} ticking={true}>/Beta</TypewriterText></button>
                </div>
            </div>  
            </div>
    );


};

export default Intro;
